import "./App.css";
import theme from "./theme";
import { ThemeProvider } from "@material-ui/core/styles";
import { Typography } from "@material-ui/core";
import ScheduleCard from "./core/components/core-schedule-card";
import Schedule from "./core/components/core-schedule";
import Switch from "./core/components/core-switch";


function App() {
  return (
    <ThemeProvider theme={theme}>
      <Typography variant="h1">Hello World</Typography>
      <Schedule/>
      <Switch></Switch>
    </ThemeProvider>

  );
}

export default App;
